  justifyContent: 'center',
  // border: 'solid 1px #ddd',
  background: '#f0f0f0',
};

export default function Main() {
  return (
    <>
      <Rnd
        style={container}
        default={{
          x: 0,
          y: 0,
          width: 320,
          height: 200,
        }}
      >
        <div className="left">aaa</div>
        <div className="main">aaa</div>
      </Rnd>
    </>
  );
}
